select 'insert into participacao_detalhada(participacao, quantidade)values(''APENAS_USUARIO'', 1); insert into informacao_atendimento_participacao_detalhada(id_informacao_atendimento, id_participacao_detalhada)values('||infate.id||',currval(''participacao_detalhada_id_seq''));' 
--distinct nomgru.nome, gru.turma, gru.id_setor, ategru.data, ateusu.id_usuario, infate.id as infate, count(distinct pardet.id) as qtd_participacao
	from atendimento_grupo ategru
	inner join atendimento_grupo_atendimento_usuario ategruateusu
		on ategruateusu.id_atendimento_grupo = ategru.id
	inner join atendimento_usuario ateusu
		on ateusu.id = ategruateusu.id_atendimento_usuario
	inner join informacao_atendimento infate
		on infate.id = ateusu.id_informacao_atendimento
	left join informacao_atendimento_participacao_detalhada infatepardet
		on infatepardet.id_informacao_atendimento = infate.id
	left join participacao_detalhada pardet
		on pardet.id = infatepardet.id_participacao_detalhada
	left join modulo_periodo_atendimento_grupo modperategru
		on modperategru.id_atendimento_grupo = ategru.id
	left join modulo_periodo modper
		on modper.id = modperategru.id_modulo_periodo
	left join modulo_periodo_modulo_usuario modpermodusu
		on modpermodusu.id_modulo_periodo = modper.id
	left join grupo_modulo_periodo grumodper
		on grumodper.id_modulo_periodo = modper.id
	left join grupo gru
		on gru.id = grumodper.id_grupo
	left join descricao_tipo_atendimento destipate
		on destipate.id = gru.id_descricao_tipo_atendimento
	left join tipo_atendimento tip
		on tip.id = destipate.id_tipo_atendimento
	left join modulo mod
		on mod.id = modper.id_modulo
	left join nome_grupo nomgru
		on nomgru.id = gru.id_nome_grupo
where ategru.data between '01/01/2017' and '31/12/2017' and infate.frequencia = 'AT' and ategru.status = 'NORMAL'
group by nomgru.nome, gru.turma, gru.id_setor, ategru.data, ateusu.id_usuario, infate.id
having count(distinct pardet.id) = 0;
